'''
PySoundFX includes various sound effects, such as delay and reverb, as well as a 3-band equalizer for easy audio processing.
'''


import numpy as np
from scipy.io import wavfile as wav
import matplotlib.pyplot as plt
from IPython.display import Audio
from scipy.signal import butter, lfilter, freqz, argrelextrema


'''
A 3-band equalizer. Adjusts the bass, midrange, and highs in 1-channel audio data.

Inputs:

audio: The audio data array
fs: Sampling frequency
G1: Bass gain in dB, default value is 0
G2: Midrange gain in dB, default value is 0
G3: Highs gain in dB, default value is 0

Outputs:

The adjusted audio array.
'''

def equalizer(audio, fs, G1=0, G2=0, G3=0):
    
    # 0-300 Hz (Bass)
    b,a = butter(7,300,'low',fs=fs)
    g1 = lfilter(b,a,audio)*(10**(G1/20))

    # 300-5000 Hz (Midrange)
    b,a = butter(7,[300,5000],'band',fs=fs)
    g2 = lfilter(b,a,audio)*(10**(G2/20))
    
    # 5000+ Hz (High)
    b,a = butter(7,5000,'high',fs=fs)
    g3 = lfilter(b,a,audio)*(10**(G3/20))

    return g1 + g2 + g3


'''
Adds a delay effect to an audio signal.

Inputs:

original: The original one-channel signal
fs: Sampling frequency
delay_time: Time delay in seconds
mag_of_delay: Controls the volume of subsequent delays
intensity: The intensity of the delay (the number of delays)
ifPlot: Plots the original and resulting graphs. Default value is 0

Outputs:

The resulting signal with specified delay.
'''

def delay_effect(original, fs, delay_time, mag_of_delay, intensity, ifPlot=0):
    original0 = original
    delayed_signal = original0
    
    for i in range(intensity):
        delayed_signal = delayed_signal/np.array(mag_of_delay, dtype=np.float64)
        delay = np.zeros(int(fs*delay_time)) * i

        delayed_signal = np.concatenate([delay,delayed_signal])
        original0 = np.concatenate([original0,delay])

        result = np.add(delayed_signal, original0)
        original0 = result
    
    if (ifPlot):
        t1 = np.arange(len(result))/fs
        t2 = np.arange(len(original))/fs
        
        fig, ax = plt.subplots(1,figsize=(6,6))
        
        plt.subplot(211)
        plt.plot(t2,original, color="orange")
        plt.title("Before")
        plt.xlabel("Time (sec)")
        
        plt.subplot(212)
        plt.plot(t1,result, color="blue")
        plt.title("After")
        plt.xlabel("Time (sec)")
        
        plt.tight_layout()
    
    return result


