'''
Applies a customizable distortion effect.

Inputs: 

original: The original signle-channel signal
fs: Sampling frequency
mag_of_dist: Magnitude of distortion
ifPlot: Plots the original and resulting graphs. Default value is 0

Outputs:

The resulting signal with specified distortion.
'''

def dist_effect(original, fs, mag_of_dist, ifPlot=0):
    result = original
    
    rel_max = argrelextrema(result, np.greater)
    values = result[rel_max[0]]
    values = values/mag_of_dist
    
    result[rel_max[0]] = values
    
    if (ifPlot):
        t1 = np.arange(len(result))/fs
        t2 = np.arange(len(original))/fs
        
        fig, ax = plt.subplots(1,figsize=(6,6))
        
        plt.subplot(211)
        plt.plot(t2,original, color="orange")
        plt.title("Before")
        plt.xlabel("Time (sec)")
        
        plt.subplot(212)
        plt.plot(t1,result, color="blue")
        plt.title("After")
        plt.xlabel("Time (sec)")
        
        plt.tight_layout()
        
    return result